text:
@TheRikeys Or the complaint that lots of creators don't make much. 

Ok...but that's the same with steam / indie games. That's the same with youtube. That's the same with twitter. That's the same with the entire internet?

But somehow it was a uniquely Roblox problem?

@TheRikeys The rebuttal is just that most of the complaints were pretty silly at face value? 

Like trying to blame Roblox for someone being cheated by his own team... and instead of him getting lawyers and handling his own business, somehow Roblox was to blame?

It makes no sense....
